import React from 'react';
import './Project.css';
import projectimages from '../ImagesLogo/netflix landing.png';

function Project() {
  return (
    <div className='projects'>
        <div className="project-title">
            <h1>Projects</h1>
        </div>
        <div className="project-all" >
            {data.map((h)=>
                <div key={h.id} className='project-lis'>
                <h4>{h.Name}</h4>
                <img  src={h.img} alt=''/>
                </div>
                )}
        </div>
    </div>
  )
}

const data=[
    {
        id:1,
        Name:'Netflix Landing Page',
        img:projectimages
    },
    {
        id:2,
        Name:'Netflix Landing Page',
        img:projectimages
    },
    {
        id:3,
        Name:'Netflix Landing Page',
        img:projectimages
    },
    {
        id:4,
        Name:'Netflix Landing Page',
        img:projectimages
    },
]

export default Project
